class TestgridIndex extends LitElement {
    constructor() {
        super(...arguments);
        this.title = 'My app';
        this.dashboards = [];
    }
    // TODO(chases2): inject an APIClient object so we can inject it into tests/storybook later
    render() {
        return html `
      <mwc-list>
        ${map(this.dashboards, (dash, index) => {
            if (index !== 0) {
                return html `
              <li divider role="separator"></li>
              <mwc-list-item>${dash}</mwc-list-item>
            `;
            }
            return html `<mwc-list-item>${dash}</mwc-list-item>`;
        })}
      </mwc-list>
      <mwc-button raised @click="${this.getDashboards}">Call API</mwc-button>
    `;
    }
    getDashboards() {
        this.dashboards = ['Loading...'];
        fetch('http://localhost:8080/api/v1/dashboards').then(async (response) => {
            const resp = ListDashboardResponse.fromJson(await response.json());
            this.dashboards = [];
            resp.dashboards.forEach(db => {
                this.dashboards.push(db.name);
            });
        });
    }
}

class DashboardSummary extends LitElement {
    constructor() {
        super(...arguments);
        this.tabSummariesInfo = [];
    }
    render() {
        return html `
      ${map(this.tabSummariesInfo, (ts) => html `<tab-summary .info=${ts}></tab-summary>`)}
      <input id="dashboard-name-input" label="Dashboard name" />
      <mwc-button raised @click="${this.getTabSummaries}">Fetch</mwc-button>
    `;
    }
    async getTabSummaries() {
        this.tabSummariesInfo = [];
        try {
            const response = await fetch(`http://localhost:8080/api/v1/dashboards/${this.input.value}/tab-summaries`);
            if (!response.ok) {
                throw new Error(`HTTP error: ${response.status}`);
            }
            const data = ListTabSummariesResponse.fromJson(await response.json());
            data.tabSummaries.forEach(ts => {
                const si = convertResponse(ts);
                this.tabSummariesInfo = [...this.tabSummariesInfo, si];
            });
        }
        catch (error) {
            console.error(`Could not get dashboard summaries: ${error}`);
        }
    }
}

